import React, { Component } from "react";
import ReactLiveSearch from 'react-live-search'

class EventSelect extends Component {

  state = {
    value: '',
    data: [
      { label: 'test', value: 1 },
      { label: 'work', value: 2 },
      { label: 'great', value: 3 },
      { label: 'bar', value: 4 },
      { label: 'foo', value: 5 }
    ]
  };

  onChange = value => {
    this.setState({
      value
    });
  };

  onSelect = v => { };


  render() {
    return (
      <ReactLiveSearch
        value={value}
        onChange={this.onChange}
        onSelect={this.onSelect}
        data={data}
      />
    )
  }
}
export default EventSelect;
